import axios from "axios";
import catchErrors from "../utils/catchErrors";
import baseUrl from "../utils/baseUrl";
import { withRouter } from 'next/router'


function Recommended({places}) {
  return <>
    <h1>DAmee</h1>
  </>;
}

Recommended.getInitialProps = async (props) => {

    console.log(props.router.query.data);
    // fetch data on server
    const url = `${baseUrl}/api/getrecomend`;

    const response = await axios.get(url);
    return { placesData: response.data };
    // return response data as an object
    // note: this object will be merged with existing props
  };

export default withRouter(Recommended);
